(251, NULL, 'admin@collegebound.app', '[Collegebound] Your site has updated to WordPress 6.0.2', 'Howdy! Your site at http://devoqdesign.com/projects/college has been updated automatically to WordPress 6.0.2.\n\nNo further action is needed on your part. For more on version 6.0.2, see the About WordPress screen:\nhttp://devoqdesign.com/projects/college/wp-admin/about.php\n\nIf you experience any issues or need support, the volunteers in the WordPress.org support forums may be able to help.\nhttps://wordpress.org/support/forums/\n\nYou also have some plugins or themes with updates available. Update them now:\nhttp://devoqdesign.com/projects/college/wp-admin/\n\nThe WordPress Team\n', '', 'a:0:{}', 'failed', 0, NULL, NULL, '2022-09-04 11:37:43', NULL, NULL, 2, 0),
(252, NULL, 'admin@collegebound.app', '[Collegebound] New User Registration', 'New user registration on your site Collegebound:\r\n\r\nUsername: coach\r\n\r\nEmail: coach@devoqdesign.com\r\n', '', 'a:0:{}', 'failed', 0, NULL, NULL, '2022-09-06 11:11:23', NULL, NULL, 2, 0),
(253, NULL, 'admin@collegebound.app', '[Collegebound] New User Registration', 'New user registration on your site Collegebound:\r\n\r\nUsername: eventoperator\r\n\r\nEmail: event@devoqdesign.com\r\n', '', 'a:0:{}', 'failed', 0, NULL, NULL, '2022-09-06 11:13:35', NULL, NULL, 2, 0),
(254, NULL, 'admin@collegebound.app', '[Collegebound] New User Registration', 'New user registration on your site Collegebound:\r\n\r\nUsername: player\r\n\r\nEmail: player@devoqdesign.com\r\n', '', 'a:0:{}', 'failed', 0, NULL, NULL, '2022-09-06 11:15:20', NULL, NULL, 2, 0),
(255, NULL, 'keyur@devoqdesign.com', '[Collegebound] Email Change Request', 'Howdy admin@collegebound.app,\n\nYou recently requested to have the email address on your account changed.\n\nIf this is correct, please click on the following link to change it:\nhttps://devoqdesign.com/projects/college/wp-admin/profile.php?newuseremail=51d202ea1657b3d8be77f539a3850f1d\n\nYou can safely ignore and delete this email if you do not want to\ntake this action.\n\nThis email has been sent to keyur@devoqdesign.com\n\nRegards,\nAll at Collegebound\nhttps://devoqdesign.com/projects/college', '', 'a:0:{}', 'failed', 0, NULL, NULL, '2022-09-08 10:11:47', NULL, NULL, 2, 0),
(256, NULL, 'admin@collegebound.app', '[Collegebound] Password Changed', 'Hi admin@collegebound.app,\n\nThis notice confirms that your password was changed on Collegebound.\n\nIf you did not change your password, please contact the Site Administrator at\nadmin@collegebound.app\n\nThis email has been sent to admin@collegebound.app\n\nRegards,\nAll at Collegebound\nhttps://devoqdesign.com/projects/college', '', 'a:0:{}', 'queued', 0, NULL, NULL, '2022-09-08 10:11:48', NULL, NULL, 0, 0) ;
